import React from 'react'
import { Image, StyleSheet, View, Text,TouchableOpacity } from 'react-native'
import Icon from 'react-native-vector-icons/FontAwesome'

const cerrar = <Icon name='arrow-left' size={20} color="white"/>;

const salir = () => {
    navigation.navigate('Statistics');
  };

const Configuration = () => {
    const estadistica = "https://i.postimg.cc/KYbfVx3p/png-transparent-computer-icons-user-encapsulated-postscript-others-miscellaneous-orange-user-profile.png";
    return (
        <View style={styles.container}>
            <View>
                <Text style={styles.text}>PERFIL</Text>
                <Image source={{ uri: estadistica }} style={styles.estad} />
                <Text style={styles.textInf}>Cédula:</Text>
                <Text style={styles.textInf}>Nombres y Apellidos:</Text>
                <Text style={styles.textInf}>Usuario:</Text>
                <Text style={styles.textInf}>Correo:</Text>
                <TouchableOpacity
                    style={styles.button}
                    onPress={salir}
                >
                    <Text style={styles.textButton}>{cerrar} Cerrar sesión</Text>
                </TouchableOpacity>
            </View>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 5,
        alignItems: 'center',
        backgroundColor: '#DEE1E6',
        marginTop: 35,
        marginLeft: 25,
        marginRight: 25,
        marginBottom: 35,
        borderRadius: 10
    },
    text: {
        marginTop: 25,
        color: 'black',
        fontSize: 20,
        textAlign: 'center',
        fontWeight: 'bold',
    },
    textInf: {
        marginTop: 20,
        marginLeft: -40,
        color: 'black',
        fontSize: 15,
        textAlign: 'left',
        fontWeight: 'bold',
    },
    estad: {
        marginTop: 30,
        width: 180,
        height: 150, // Ajusta la altura deseada para la imagen
    },
    button:{
        marginTop: 50,
        borderWidth: 1,
        borderColor: '#fd7858',
        backgroundColor: '#fd7858',
        padding: 10,
        borderRadius: 7,
    },
    textButton:{
        icon: 'account-cog',
        textAlign:'center',
        fontSize: 17,
        color:'white',
        
    }
})

export default Configuration;
